import React, { useState } from "react";
import { Container, Table } from "react-bootstrap";


const TableP = () => 
{
    const [Matches, setMatches] = useState(Array(3).fill(0))
    const [data, setData] = useState({ })
    return(
    <>
    <div>
        <body>
            <Container>
            <Table striped bordered size="sm">
                <thead className="text-center">
                    <tr width='100%'>
                        Weekly Finals
                    </tr>
                </thead>
                <thead className="text-center">
                    <td>Teams</td>
                    {
                       Matches.map((Matches, index) => {
                            return <td>Match {index+1}</td>  
                        }  )
                    }
                </thead>
                <tbody>
                    <tr>
                        <td>Team Game</td>
                        {
                            Matches.map((Matches) => {
                                return <td value={Array.push()}>33</td>
                            })
                        }
                    </tr>
                </tbody>
            </Table>
            </Container>
        </body>
    </div>
    </>
    )
}

export default TableP;
